import React from 'react';

// Define an interface representing the structure of the data coming from the API
interface Submission {
    id: number;
    title: string;
    content: string;
    author: {
        id: number;
        name: string;
        email: string;
    };
    // Add more properties as needed
}

// Define a functional component
const SubmissionComponent: React.FC<{ submission: Submission }> = ({ submission }) => {
    return (
        <div>
            <h2>{submission.title}</h2>
            <p>{submission.content}</p>
            <p>Author: {submission.author.name}</p>
            <p>Email: {submission.author.email}</p>
            {/* Render more properties as needed */}
        </div>
    );
}

export default SubmissionComponent;
